import React, { useState, useEffect } from 'react';

// Helper for random assignment
function getRandom(arr) {
  return arr[Math.floor(Math.random() * arr.length)];
}

function SoarOps() {
  // --- State variables ---
  const [showAdminModal, setShowAdminModal] = useState(false);
  const [adminCode, setAdminCode] = useState('');
  const [isAdminMode, setIsAdminMode] = useState(false);
  const [showCastAccess, setShowCastAccess] = useState(false);

  const [currentTime, setCurrentTime] = useState(new Date().toLocaleTimeString([], {hour: '2-digit', minute:'2-digit'}));
  const [currentDate, setCurrentDate] = useState(new Date().toLocaleDateString('en-US', {
    weekday: 'long',
    year: 'numeric',
    month: 'long',
    day: 'numeric'
  }));

  // --- Cast Access State ---
  const [castStatus, setCastStatus] = useState("Off Duty");
  const [castAssignment, setCastAssignment] = useState(null);

  // --- Dashboard State (from your original script, trimmed for clarity) ---
  const [guestCount, setGuestCount] = useState(36542);
  const [dailyCapacity, setDailyCapacity] = useState(50000);
  const [capacityPercentage, setCapacityPercentage] = useState(73);

  const [liveWaitTime, setLiveWaitTime] = useState(45);
  const [hourlyWaitTimes, setHourlyWaitTimes] = useState([
    { hour: '8 AM', waitTime: 30 },
    { hour: '9 AM', waitTime: 35 },
    { hour: '10 AM', waitTime: 50 },
    { hour: '11 AM', waitTime: 65 },
    { hour: '12 PM', waitTime: 70 },
    { hour: '1 PM', waitTime: 55 },
    { hour: '2 PM', waitTime: 45 },
    { hour: '3 PM', waitTime: 40 },
    { hour: '4 PM', waitTime: 35 },
    { hour: '5 PM', waitTime: 40 },
    { hour: '6 PM', waitTime: 30 },
    { hour: '7 PM', waitTime: 25 }
  ]);
  const [hourlyEfficiency, setHourlyEfficiency] = useState([
    { hour: '8 AM', efficiency: 91 },
    { hour: '9 AM', efficiency: 93 },
    { hour: '10 AM', efficiency: 96 },
    { hour: '11 AM', efficiency: 94 },
    { hour: '12 PM', efficiency: 89 },
    { hour: '1 PM', efficiency: 87 },
    { hour: '2 PM', efficiency: 90 },
    { hour: '3 PM', efficiency: 94 },
    { hour: '4 PM', efficiency: 96 },
    { hour: '5 PM', efficiency: 97 },
    { hour: '6 PM', efficiency: 95 },
    { hour: '7 PM', efficiency: 92 }
  ]);
  const [theaterStatus, setTheaterStatus] = useState({
    'A': 'Operational',
    'B': 'Operational',
    'C': 'Maintenance'
  });
  const theaterNames = {
    'A': 'A Theater',
    'B': 'B Theater',
    'C': 'C Theater'
  };
  const positions = [
    'Standby Greeter',
    'Lightning Lane 1',
    'Lightning Lane 2',
    'Tour Desk',
    'Lost & Found',
    'Pre-Merge',
    'Merge',
    'Tower A',
    'Tower B',
    'Tower C',
    'Grouper',
    'A Gate',
    'B Gate',
    'C Gate',
    'Assist',
    'Wheelchair Assist',
    'Lead',
    'Operator',
    'Greeter',
    'Technician',
    'Supervisor'
  ];

  // --- Leadership/Admin Modal Logic ---
  const verifyAdminCode = () => {
    if (adminCode === '123456789') {
      setIsAdminMode(true);
      setShowAdminModal(false);
    } else {
      alert('Invalid authorization code. Please try again or contact your supervisor.');
    }
  };

  // --- Cast Access Logic ---
  const handleClockIn = () => {
    setCastStatus("On Duty");
    setCastAssignment(null);
  };
  const handleGetAssignment = () => {
    setCastAssignment({
      position: getRandom(positions),
      theater: getRandom(['A', 'B', 'C'])
    });
    setCastStatus("On Duty");
  };
  const handleLunch = () => {
    setCastStatus("On Break");
  };
  const handleClockOut = () => {
    setCastStatus("Off Duty");
    setCastAssignment(null);
  };

  // --- Time/Capacity Updater ---
  useEffect(() => {
    const timer = setInterval(() => {
      const now = new Date();
      setCurrentTime(now.toLocaleTimeString([], {hour: '2-digit', minute:'2-digit'}));
      setCurrentDate(now.toLocaleDateString('en-US', {
        weekday: 'long',
        year: 'numeric',
        month: 'long',
        day: 'numeric'
      }));
      // Simulate light capacity fluctuation
      setCapacityPercentage(prev => Math.max(60, Math.min(95, prev + (Math.floor(Math.random() * 3) - 1))));
    }, 60000);
    return () => clearInterval(timer);
  }, []);
  useEffect(() => {
    setGuestCount(Math.round(dailyCapacity * capacityPercentage / 100));
  }, [capacityPercentage, dailyCapacity]);

  // --- UI Styles ---
  const buttonStyle = {
    padding: "10px 18px",
    backgroundColor: "#0066b2",
    color: "white",
    border: "none",
    borderRadius: "6px",
    cursor: "pointer",
    fontWeight: "600",
    fontSize: "16px",
    margin: "0 8px 0 0"
  };
  const secondaryButtonStyle = {
    ...buttonStyle,
    backgroundColor: "#10b981"
  };
  const navButtonStyle = {
    ...buttonStyle,
    backgroundColor: "#f1f5fb",
    color: "#0066b2",
    border: "1px solid #e0e8f5"
  };

  // --- Main Render ---
  return (
    <div
      style={{
        padding: "32px",
        backgroundColor: "#f5f9ff",
        fontFamily: '"Avenir Next", "Segoe UI", Arial, sans-serif',
        borderRadius: "16px",
        boxShadow: "0 4px 20px rgba(0,0,0,0.08)",
        maxWidth: "1100px",
        margin: "40px auto",
        border: "1px solid #e0e8f5"
      }}
    >
      {/* Header */}
      <div
        style={{
          display: "flex",
          alignItems: "center",
          justifyContent: "space-between",
          marginBottom: "24px",
          borderBottom: "2px solid #e0e8f5",
          paddingBottom: "18px"
        }}
      >
        <div style={{ display: "flex", alignItems: "center" }}>
          <div
            style={{
              width: "48px",
              height: "48px",
              backgroundColor: "#0066b2",
              borderRadius: "10px",
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              color: "white",
              fontWeight: "bold",
              fontSize: "24px",
              marginRight: "16px"
            }}
          >
            <span role="img" aria-label="castle">
              🏰
            </span>
          </div>
          <div>
            <h1
              style={{
                color: "#0066b2",
                fontSize: "28px",
                margin: "0 0 4px 0",
                fontWeight: "700",
                letterSpacing: "-0.5px"
              }}
            >
              SoarOps Command Center
            </h1>
            <div style={{
              display: 'flex',
              alignItems: 'center',
              color: '#637385',
              fontSize: '15px',
              gap: '20px'
            }}>
              <p style={{ margin: 0 }}>Attraction Operations Management</p>
              <span style={{ color: '#0066b2', fontWeight: '500' }}>{currentTime}</span>
              <span style={{ color: '#637385' }}>{currentDate}</span>
            </div>
          </div>
        </div>
        <div>
          <button
            style={navButtonStyle}
            onClick={() => {
              setShowCastAccess(false);
              setIsAdminMode(false);
            }}
          >
            Home
          </button>
          <button
            style={navButtonStyle}
            onClick={() => {
              setShowCastAccess(false);
              setShowAdminModal(true);
            }}
          >
            Leadership Access
          </button>
          <button
            style={secondaryButtonStyle}
            onClick={() => {
              setShowCastAccess(true);
              setIsAdminMode(false);
              setShowAdminModal(false);
            }}
          >
            Cast Access
          </button>
        </div>
      </div>

      {/* Admin Modal */}
      {showAdminModal && (
        <div
          style={{
            position: "fixed",
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            backgroundColor: "rgba(0,0,0,0.5)",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            zIndex: 1000
          }}
        >
          <div
            style={{
              backgroundColor: "white",
              padding: "32px",
              borderRadius: "12px",
              width: "350px",
              boxShadow: "0 4px 20px rgba(0,0,0,0.15)"
            }}
          >
            <h2
              style={{
                margin: "0 0 20px 0",
                color: "#0066b2",
                fontSize: "22px"
              }}
            >
              Leadership Authentication
            </h2>
            <p
              style={{
                fontSize: "14px",
                color: "#637385",
                marginBottom: "15px"
              }}
            >
              Enter leadership code to access admin features:
            </p>
            <input
              type="password"
              value={adminCode}
              onChange={(e) => setAdminCode(e.target.value)}
              placeholder="Enter code"
              style={{
                width: "100%",
                padding: "12px",
                borderRadius: "6px",
                border: "1px solid #ddd",
                marginBottom: "20px",
                fontSize: "15px"
              }}
              onKeyDown={(e) => {
                if (e.key === "Enter") {
                  verifyAdminCode();
                }
              }}
            />
            <div style={{ display: "flex", justifyContent: "flex-end", gap: "10px" }}>
              <button
                style={navButtonStyle}
                onClick={() => setShowAdminModal(false)}
              >
                Cancel
              </button>
              <button style={buttonStyle} onClick={verifyAdminCode}>
                Login
              </button>
            </div>
          </div>
        </div>
      )}

      {/* Cast Access Page */}
      {showCastAccess && (
        <div
          style={{
            background: "white",
            borderRadius: "12px",
            padding: "36px",
            boxShadow: "0 2px 10px rgba(0,0,0,0.06)",
            border: "1px solid #eef2f8",
            maxWidth: "420px",
            margin: "0 auto"
          }}
        >
          <h2 style={{ color: "#0066b2", fontWeight: 700, marginBottom: 12 }}>
            Cast Member Portal
          </h2>
          <div style={{ marginBottom: 22 }}>
            <div style={{ fontSize: 18, marginBottom: 4 }}>
              <b>Status:</b>{" "}
              <span
                style={{
                  color:
                    castStatus === "On Duty"
                      ? "#10b981"
                      : castStatus === "On Break"
                      ? "#f59e0b"
                      : "#637385"
                }}
              >
                {castStatus}
              </span>
            </div>
            <div style={{ fontSize: 16, marginBottom: 8 }}>
              <b>Assignment:</b>{" "}
              {castAssignment ? (
                <span>
                  {castAssignment.position} - {theaterNames[castAssignment.theater]}
                </span>
              ) : (
                <span style={{ color: "#999" }}>None</span>
              )}
            </div>
          </div>
          <div style={{ display: "flex", flexDirection: "column", gap: 12 }}>
            <button
              style={buttonStyle}
              onClick={handleClockIn}
              disabled={castStatus === "On Duty"}
            >
              Clock-In
            </button>
            <button
              style={buttonStyle}
              onClick={handleGetAssignment}
              disabled={castStatus !== "On Duty"}
            >
              Get Assignment
            </button>
            <button
              style={buttonStyle}
              onClick={handleLunch}
              disabled={castStatus !== "On Duty"}
            >
              Lunch
            </button>
            <button
              style={buttonStyle}
              onClick={handleClockOut}
              disabled={castStatus === "Off Duty"}
            >
              Clock Out
            </button>
          </div>
        </div>
      )}

      {/* Main Dashboard */}
      {!showCastAccess && !isAdminMode && (
        <div style={{ marginTop: 32 }}>
          <div
            style={{
              display: "flex",
              gap: "32px",
              flexWrap: "wrap",
              justifyContent: "space-between"
            }}
          >
            <div
              style={{
                flex: 1,
                minWidth: "260px",
                background: "white",
                borderRadius: "10px",
                padding: "28px",
                boxShadow: "0 2px 10px rgba(0,0,0,0.05)",
                border: "1px solid #eef2f8"
              }}
            >
              <h3 style={{ color: "#0066b2", fontSize: "19px", margin: "0 0 10px 0" }}>
                Current Guest Count
              </h3>
              <div
                style={{
                  fontSize: "34px",
                  fontWeight: "bold",
                  color: "#10b981",
                  marginBottom: "10px"
                }}
              >
                {guestCount.toLocaleString()}
              </div>
              <div style={{ color: "#637385", fontSize: "15px" }}>
                Capacity: {capacityPercentage}%
              </div>
            </div>
            <div
              style={{
                flex: 1,
                minWidth: "260px",
                background: "white",
                borderRadius: "10px",
                padding: "28px",
                boxShadow: "0 2px 10px rgba(0,0,0,0.05)",
                border: "1px solid #eef2f8"
              }}
            >
              <h3 style={{ color: "#0066b2", fontSize: "19px", margin: "0 0 10px 0" }}>
                Live Wait Time
              </h3>
              <div
                style={{
                  fontSize: "34px",
                  fontWeight: "bold",
                  color: "#f59e0b",
                  marginBottom: "10px"
                }}
              >
                {liveWaitTime} min
              </div>
            </div>
          </div>
          <div style={{ marginTop: 32, color: "#637385", fontSize: "15px" }}>
            <b>Welcome to SoarOps!</b> For Cast features, use the <b>Cast Access</b> button above.
          </div>
        </div>
      )}

      {/* Leadership/Admin Mode Placeholder */}
      {isAdminMode && !showCastAccess && (
        <div
          style={{
            margin: "40px auto",
            background: "white",
            borderRadius: "12px",
            padding: "36px",
            boxShadow: "0 2px 10px rgba(0,0,0,0.06)",
            border: "1px solid #eef2f8",
            textAlign: "center"
          }}
        >
          <h2 style={{ color: "#0066b2", fontWeight: 700, marginBottom: 18 }}>
            Leadership Dashboard
          </h2>
          <p style={{ color: "#637385", fontSize: "16px" }}>
            Full admin features would appear here.
          </p>
          <button
            style={buttonStyle}
            onClick={() => setIsAdminMode(false)}
          >
            Exit Leadership Mode
          </button>
        </div>
      )}
    </div>
  );
}

export default SoarOps;
